import React from 'react';
import './ExtracurricularsInterests.css';

const ExtracurricularsInterests = () => {
    const activities = [
        {
            title: 'Dianmao Technology',
            description: 'Data analytics intern, in-depth study of RMFM model and its application scenarios, all-round learning of ROI, LTV algorithms.',
            image: 'https://static.codemao.cn/community_official/static/media/logo.1756fd4f.png',
        },
        {
            title: 'Alibaba',
            description: 'Perform deep day analysis of order data.',
            image: 'data:image/png;base64,',
        },
        {
            title: 'Data Analysis Boot Camp',
            description: '.',
            image: 'data:image/jpeg;base64,',
        },
    ];

    return (
        <section className="extracurriculars-interests" id="interests">
            <div className="extracurriculars-interests-content">
                <h2 className="extracurriculars-interests-title">Extracurriculars & Interests</h2>
                <div className="activities-list">
                    {activities.map((activity, index) => (
                        <div className="activity-card" key={index}>
                            <img src={activity.image} alt={activity.title} className="activity-image" />
                            <div className="activity-info">
                                <h3 className="activity-title">{activity.title}</h3>
                                <p className="activity-description">{activity.description}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default ExtracurricularsInterests;
